INSERT INTO `faq` (`id`, `title`, `description`) VALUES
(1, 'Apa Itu Cari Sayur', 'Cari Sayur adalah Portal Belanja Online yang melayani penjualan komoditi sayuran segar, buah-buahan dan bumbu-bumbu dengan kualitas Pasar Induk terbaik dengan harga kompetitif.'),
(2, 'Apa sajakah yang dijual oleh Carisayur?', 'Cari Sayur menjual berbagai macam jenis hasil pertanian, seperti buah-buahan dan sayuran segar, lalu kami juga menjual bumbu, telur dan beras, dll');
INSERT INTO `hotel` (`id`, `judul`, `image`, `text`, `brosur`, `whatsapp`, `harga`) VALUES
(4, 'Hotel Asri Sumedang', '240507120020428.jpg', '&amp;lt;p&amp;gt;Terletak di Sumedang, 43 km dari Saung Angklung Udjo, Hotel Asri Sumedang menawarkan akomodasi dengan tempat fitness lengkap, parkir pribadi gratis, dan taman. Selain WiFi gratis, hotel bintang 3 ini menawarkan resepsionis 24 jam. Trans Studio Bandung lokasinya sejauh 46 km, dan Gedung Sate berjarak 46 km dari hotel.&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;Di hotel, kamar memiliki AC dan TV layar datar.&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;Braga City Walk berjarak 48 km dari Hotel Asri Sumedang, sementara Stasiun Kereta Bandung terletak sejauh 49 km. Bandara terdekat adalah Bandara Internasional Husein Sastranegara, 50 km dari Hotel Asri Sumedang.&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;Pasangan paling suka lokasinya &mdash; mereka memberi nilai 9,5 untuk perjalanan dua orang.&amp;lt;/p&amp;gt;', '', '085657257215', 500000);
