(1, 'Tahu Goreng Sumedang', '10000', 0, '2405071015106395.jpg', '&amp;lt;p&amp;gt;Makanan Khas Sumedang&nbsp; yang paling dikenal adalah tahu goreng sumedang .&nbsp;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;Tahu Sumedang mempunyai keunikan sendiri dibandingkan dengan jenis tahu lainnya seperti rasanya yang gurih dan mempunyai kulit luar yang berbintik &ndash; bintik&amp;lt;br&amp;gt;&amp;lt;/p&amp;gt;', 1),
(2, 'Oncom Sumedang', '50000', 0, '2405071021565793.jpg', '&amp;lt;p&amp;gt;Olahan makanan tradisional dari Oncom Pasireungit terbaik yang terbuat dari dari kacang tanah terbaik, diolah dengan rempah rempah segar dan tanpa MSG&amp;lt;/p&amp;gt;', 1);
