INSERT INTO `trip` (`id`, `judul`, `image`, `text`, `brosur`, `whatsapp`) VALUES
(3, 'Wisata Di Curug Cinulang', '2405071053097015.jpg', '&amp;lt;p&amp;gt;Ini sebenarnya adalah wisata alam di daerah perbatasan antara bandung dan sumendang. Sebenarnya wisata yang cukup terkenal karena lagu sunda yang mengangkat nama wisata ini. Cuma jarang ada moda transportasi umum ke sini&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;Tempat yang bagus untuk dikunjungi bersama keluarga. Jalan yang sempit dengan kondisi jalan yang cukup baik, direkomendasikan untuk menggunakan mobil, motor atau sepeda.&amp;lt;/p&amp;gt;&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;', '', '085657257215');
